import{_ as r,o,c as d,ah as e}from"./chunks/framework.PKn7PQPU.js";const p=JSON.parse('{"title":"组件标识","description":"","frontmatter":{},"headers":[],"relativePath":"cn/_common/start/sign.md","filePath":"cn/_common/start/sign.md"}'),n={name:"cn/_common/start/sign.md"};function s(c,t,g,a,b,i){return o(),d("div",null,[...t[0]||(t[0]=[e('<h1 id="组件标识" tabindex="-1">组件标识 <a class="header-anchor" href="#组件标识" aria-label="Permalink to &quot;组件标识&quot;">​</a></h1><p>在浏览 TechUI 组件文档时，您会在部分组件的标题旁看到特定的 <strong>徽章 (Badge)</strong> 标识。</p><p>TechUI 始终秉持坦诚与尊重的原则。为了明确组件的权利归属与设计来源，我们制定了以下标识规范。</p><h2 id="标识含义" tabindex="-1">标识含义 <a class="header-anchor" href="#标识含义" aria-label="Permalink to &quot;标识含义&quot;">​</a></h2><table tabindex="0"><thead><tr><th>标识 (Type)</th><th>含义说明 (Description)</th><th>适用场景 / 属性说明</th></tr></thead><tbody><tr><td><strong>🏆 行业首创</strong> <br><code>ind</code></td><td><strong>颠覆性创新：</strong> 表示在整个前端行业内具有开创性意义，<br>打破了既有的技术边界或交互模式。(如前端许可证)</td><td><strong>主题：</strong> <code>danger</code><br>(高亮警示)</td></tr><tr><td><strong>👑 首创</strong> <br><code>1st</code></td><td><strong>TechUI 独家发明：</strong> 表示概念或实现方式为业界首创，<br>且代码完全由 TechUI 团队自研。代表核心创新能力。</td><td><strong>主题：</strong> <code>warning</code><br>(金牌品质)</td></tr><tr><td><strong>🏅 原创</strong> <br><code>ori</code></td><td><strong>代码自研：</strong> 虽行业已有类似功能，由 TechUI 独立<br>设计并编写，代码为 100% 自研。</td><td><strong>主题：</strong> <code>warning</code><br>(品质保证)</td></tr><tr><td><strong>⭐ 明星组件</strong> <br><code>star</code></td><td><strong>高热度推荐：</strong> 指代社区反馈极佳、功能最为完善<br>或使用频率极高的核心标杆组件。</td><td><strong>主题：</strong> <code>danger</code><br>(重点关注)</td></tr><tr><td><strong>💎 高级组件</strong> <br><code>adv</code></td><td><strong>高价值组件：</strong> 属于旗舰级组件或特定高级功能集合，<br>涉及核心业务逻辑或复杂底层技术。</td><td><strong>主题：</strong> <code>primary</code><br>(专业授权)</td></tr><tr><td><strong>🧬 移植自 [库名]</strong> <br><code>port</code></td><td><strong>致敬与复刻：</strong> 深度参考、移植自其他优秀开源库。<br>在移植时会保留原作者版权声明并进行适配优化。</td><td><strong>主题：</strong> <code>primary</code><br>(开源兼容)</td></tr><tr><td><strong>🧊 增强封装</strong> <br><code>enh</code></td><td><strong>深度定制：</strong> 基于成熟第三方库进行深度二次开发，简<br>化繁琐配置并注入 TechUI 视觉基因，实现开箱即用。</td><td><strong>主题：</strong> <code>primary</code><br>(易用增强)</td></tr><tr><td><strong>🧪 实验组件</strong> <br><code>exp</code></td><td><strong>实验组件：</strong> 首次发布，还在测试阶段的组件，随时可<br>能进行迭代修改，如外观，Props等内容，谨慎使用。</td><td><strong>主题：</strong> <code>success</code><br>(可能随时变动)</td></tr><tr><td><strong>💛 由 [作者] 投稿</strong> <br><code>cont</code></td><td><strong>社区贡献：</strong> 表示该组件由社区开发者贡献。如为<br>贡献者自研，会标注为 <code>由 [作者] 原创 投稿</code>。</td><td><strong>主题：</strong> <code>important</code><br>(荣誉贡献)</td></tr><tr><td><strong>⚡ WASM 驱动</strong> <br><code>wasm</code></td><td><strong>高性能核心：</strong> 表示该组件的核心计算逻辑由 <code>Rust</code> <br>编写并编译为 <code>Wasm</code>，拥有极致性能。</td><td>主题：<code>info</code><br>(硬核技术)</td></tr><tr><td><strong>🧊 WebGL/3D</strong> <br><code>gl</code></td><td><strong>3D 渲染：</strong> 表示该组件依赖 Three.js 或原生 WebGL <br>上下文。通常对显卡有一定要求，属于重度可视化组件。</td><td>主题：<code>info</code><br>(视觉引擎)</td></tr><tr><td><strong>🎨 纯 CSS</strong> <br><code>css</code></td><td><strong>轻量级：</strong> 表示该组件完全由 CSS/SVG 实现，无或者<br>极少 JS 逻辑。零依赖，渲染开销极低，适合静态装饰。</td><td>主题：<code>success</code><br>(轻量高效)</td></tr><tr><td><strong>🧠 逻辑组件</strong> <br><code>logic</code></td><td><strong>无 UI：</strong> 表示这是一个“无头”组件或 Hooks，仅提供<br>交互逻辑或数据处理能力，不包含具体 UI 样式。</td><td>主题：<code>warning</code><br>(底层能力)</td></tr><tr><td><strong>🆕 新增</strong><br><code>new</code></td><td><strong>近期发布：</strong> 表示该组件为最近 1-2 个小版本内新加入的<br>成员。用于在侧边栏或列表中快速吸引用户注意。</td><td>主题：<code>danger</code><br>(新鲜出炉)</td></tr><tr><td><strong>🔓 已开源</strong><br><code>os</code></td><td><strong>完全免费：</strong> 表示该组件已正式纳入 <code>TechUI 开源库</code>。<br>无论个人学习还是商业项目，均可无限制免费使用。</td><td>主题：<code>success</code><br>(绿色/开放)</td></tr><tr><td><strong>⏳ 待废弃</strong><br><code>leg</code></td><td><strong>停止维护：</strong> 表示该组件已进入生命周期尾声，将在未来版本<br>中移除。建议不要在新功能中使用，并尽快迁移至替代方案。</td><td>主题：<code>default</code><br>(灰色/过时)</td></tr><tr><td><strong>⛔ 已废弃</strong><br><code>dep</code></td><td><strong>停止维护：</strong> 表示该组件已不再推荐使用，可能在未来<br>版本中移除。通常会提供替代方案或迁移指南。</td><td>主题：<code>default</code><br>(灰色/过时)</td></tr></tbody></table><h2 id="无标识组件" tabindex="-1">无标识组件 <a class="header-anchor" href="#无标识组件" aria-label="Permalink to &quot;无标识组件&quot;">​</a></h2><p>您会发现 TechUI 组件库中绝大多数的基础组件（如 Button, Input, Layout 等）<strong>没有任何标识</strong>。</p><p><strong>这并不代表拿来主义，而是源于设计模式的通用性。</strong></p><p>在前端 UI 发展的长河中，许多基础组件的交互范式已经趋同，难以（也无必要）追溯最早的起源：</p><ul><li><strong>Row+Col (栅格)</strong>：最早普及于 Bootstrap，现已成为所有 UI 库的标配。</li><li><strong>Tree / Message</strong>：交互逻辑深受 Element UI 等先驱的影响。</li><li><strong>Button / Form</strong>：属于 Web 标准控件的封装。</li></ul><p>对于这些<strong>高度通用化</strong>的组件，TechUI 均采用 <strong>“参考业界标准 + 独立实现代码”</strong> 的方式开发，因此不再单独添加来源标识。</p><h2 id="未来与生态策略" tabindex="-1">未来与生态策略 <a class="header-anchor" href="#未来与生态策略" aria-label="Permalink to &quot;未来与生态策略&quot;">​</a></h2><p>TechUI 的愿景是构建一个全能的组件生态。</p><p>为了让 <strong>TechUI</strong> 基础库能够快速满足复杂的业务需求，在未来的迭代中，我们可能会采取 <strong>“拿来主义”</strong> 策略——直接移植部分经过市场验证的、优秀的开源组件（如复杂的日期选择器、富文本编辑器等）。</p><p>对于此类移植组件，我们将严格遵守开源协议，并在文档显著位置标注 <strong><code>移植自 [XXX]</code></strong>，以向原作者致以最崇高的敬意。</p><p>我们相信，站在巨人的肩膀上，才能看得更远。</p>',16)])])}const l=r(n,[["render",s]]);export{p as __pageData,l as default};
